# include <iostream>
# include <time.h>
# include <cstdlib>
using std::cout;
using std::endl;
using std::swap;

int k = 0;

int partition(int arr[], int low, int high)
{
	// Assigning a random element in the array the last position.
	srand(time(0));
    int random = rand() % (high - low) + low;
    swap(arr[random], arr[high]);
    //
    
    int pivot = arr[high];
	
	
	k += 1;
    cout << "Pivot " << k <<" : " << pivot << endl;	// Prints the Number of Pivot that has happened and the Pivot element.
    cout << "high : " << high << endl;
    cout << "low : " << low << endl;
    cout << "\n-----------------------\n" << endl;
	
	int i = (low - 1);
	
	for(int j = low; j < high; j++)
	{
		if(arr[j] <= pivot)
		{
			i++;
			swap(arr[i], arr[j]);
		}
	}
	swap(arr[i + 1], arr[high]);
	return (i + 1);
}

void quick_sort(int arr[], int low, int high)
{
	if(low < high)
	{
		int pi = partition(arr, low, high);
		
		quick_sort(arr, pi+1, high);
		quick_sort(arr, low, pi-1);
	}
}


